var express = require('express');
var router = express.Router();
const fs = require('fs');
const path = require('path');

const puppeteer = require('puppeteer');
const auth = require('../middleware/auth');

router.post('/generate-pdf', auth.auth, async (req, res) => {

    try {

        const { html, logo, id } = req.body;
        if (!html || !logo) {
            return res.status(400).json({ error: 'HTML and logo are required.' });
        }


        // Define the header and footer templates
        const headerTemplate = `
            <div style="width: 100%; text-align: center; font-size: 10px; display: flex; align-items: center; justify-content: space-between; padding: 10px 70px;">
                <img src="${logo}" style="height: 30px;" alt="Logo">
                <span>Report</span>
            </div>
        `;

        const footerTemplate = `
            <div style="width: 100%; text-align: center; font-size: 10px; padding: 5px;">
                <span class="pageNumber"></span> / <span class="totalPages"></span>
            </div>
        `;

        const customStyles = `
        <style>
        
            @font-face {
                font-family: 'Axiforma';
                src: url(data:font/woff2;base64,);
            }
            

            #pdf-content {
                font-family: 'Axiforma';
                font-size: 13px;
                color: #133d5a;
            }


            /* General table styling */
            table {
              width: 100%;
              border-collapse: collapse;
                margin: 20px 0px 40px 0px;
              font-size: 13px;
            }

            /* Table header styling */
            table thead th {
              background-color: #c9d6df;
              text-align: left;
              padding: 10px 5px;
              border-bottom: solid 2px #c9d6df;
              margin-top: 6px;
              font-family: Axiforma;
              font-size: 13px;
              font-weight: normal;
              font-stretch: normal;
              font-style: normal;
              line-height: 1.54;
              letter-spacing: normal;
              color: #638b9b;
            }

            /* Table cell styling */
            table tbody td {
              padding: 8px 5px;
              color: #133d5a;
              border-bottom: solid 1px #c9d6df;
              font-family: Axiforma;
              font-size: 12px;
              font-weight: normal;
              font-stretch: normal;
              font-style: normal;
              line-height: 1.71;
              letter-spacing: normal;
            }

            /* Inner tables (nested tables) styling */
            .inner-table {
              width: 100%;
              border-collapse: collapse;
            }

            .inner-table thead th,
            .inner-table tbody td {
              font-size: 13px;
              padding: 8px;
              color: #133d5a;
            }

            .inner-table thead th {
              font-weight: bold;
              background-color: #c9d6df;
            }

            /* Image styling in table cells */
            table tbody td img {
              max-width: 100px;
              height: auto;
              margin: 5px 0;
              display: block;
            }

            /* Center text alignment for specific cells */
            .center {
              text-align: center;
            }

            /* Wrap text for table cells with longer content */
            .wrap-text {
              white-space: pre-wrap;
              word-wrap: break-word;
            }

            /* Link styling inside tables */
            .link-cell a {
              color: #133d5a;
              text-decoration: underline;
              word-break: break-all;
            }

            .title
            {
              font-family: Axiforma;
              font-size: 22px;
              font-weight: bold;
              font-stretch: normal;
              font-style: normal;
              line-height: 34px;
              letter-spacing: normal;
              color: #133d5a;
              margin-bottom: 20px;
            }

            .subtitle
            {
              font-family: Axiforma;
              font-size: 14px;
              font-weight: normal;
              font-stretch: normal;
              font-style: normal;
              line-height: 1.43;
              letter-spacing: 2.3px;
              color: #638b9b;
              text-transform: uppercase;
              margin-bottom: 20px;
            }

            /* Ensure this div will cause a page break in the PDF */
            .page-break {
              page-break-before: always;
              page-break-after: always;
            }
            
            td::first-letter {
              text-transform: capitalize
            }
            
            .link-cell::first-letter {
              text-transform: lowercase
            }
            
            .include-table, .include-table th, .include-table td {
              padding: 2px;
            
            }
            
            .inner-table {
              width: 100%;
              border: 0px solid white !important;
            }
            
            .wrap-text {
              white-space: pre-wrap;
              word-wrap: break-word;
              max-width: 200px;
            }
            
            .center {
              text-align: center;
            }
        </style>
    `;

        // Launch Puppeteer
        const browser = await puppeteer.launch();
        const page = await browser.newPage();

        // Combine HTML and styles
        const fullHTML = `
            <!DOCTYPE html>
            <html>
                <head>${customStyles}</head>
                <body>${html}</body>
            </html>
        `;

        // Set the content for the page
        await page.setContent(fullHTML, { waitUntil: 'networkidle0' });

        // Generate the PDF
        const pdfBuffer = await page.pdf({
            format: 'A4',
            displayHeaderFooter: true,
            headerTemplate: headerTemplate,
            footerTemplate: footerTemplate,
            margin: {
                top: '100px',
                bottom: '50px',
                left: '20px',
                right: '20px',
            },
        });

        await browser.close();

        // Define the file path to save the PDF
        const filePath = path.join(__dirname, '../generated_pdfs', `report-${id}.pdf`);

        // Ensure the directory exists
        fs.mkdirSync(path.dirname(filePath), { recursive: true });

        // Save the PDF to the local file system
        fs.writeFileSync(filePath, pdfBuffer);

        res.json({ message: 'PDF generated successfully',success: true});

    } catch (error) {
        console.error('Error generating PDF:', error);
        res.status(500).json({ error: 'Internal Server Error' ,success:false});
    }
});

module.exports = router;
